import {Routes, Route, Link} from 'react-router-dom';
import ProjectPage from './ProjectPage';
import {projects} from './project_list';

function ProjectList() {
    return (
        <>
            <h2>
                Projects
            </h2>
            <ul>
                {projects.forEach(function(projectId, project) {
                    <li key={projectId} className="project-card">
                        <h3><Link to={`${projectId}`}>{project.title}</Link></h3>
                        <p>{project.description}</p>
                    </li>
                })}
            </ul>
        </>
    );
}

const Projects = () => {
    return (
        <div className="project-feed">
            <Routes>
                <Route index element={<ProjectList projects={projects} />} />
                <Route path=":projectId" element={<ProjectPage />}/>
            </Routes>
        </div>
    );
};

export default Projects;
